import Select from 'react-select';

const CustomSelectProps = (props) => {

  return (
    <Select
      options={[
          {value: 'red', label: 'Red'},
          {value: 'blue', label: 'Blue'}
      ]}
    />
  );

};

export default CustomSelectProps;
